import TestReport from "../components/pages/Admin/ExamReport/ExamReport";
import ManageTest from "../components/pages/Admin/ManageExams/ManageExams";
import { ManageQuestions } from "../components/pages/Admin/ManageQuestions/ManageQuestions";

export const adminMenu = [
    {
        title: 'Manage Questions',
        content: <ManageQuestions></ManageQuestions>
    },
    {
        title: 'Manage Test',
        content: <ManageTest></ManageTest>
    },
    {
        title: 'Manage Reports',
        content: <TestReport></TestReport>
    }
];
